import React from "react";

import data from './data.json';

function getData() {
    return data;
}

function renderHeaders(){
    const HEADERS = ["Region Name",
                     "Region alpha code",
                     "Value",
                     "Reference date"];

    HEADERS.map((element,i) => {
        return (<th> {element} </th>); 
    }); 

}

class MainTable extends React.Component {


    constructor(props) {
        super(props)
        this.state = {
            json: []
        }
    }

    componentDidMount() {
        this.setState((prevState) => {
            return {
                json: getData()
            }
        })
    }

    render() {
        return (
            <div>
                <table>
                    <thead>
                        <tr>
                            {renderHeaders()}
                            <th>Region name</th>
                            <th>Region alpha code</th>
                            <th>Value</th>
                            <th>Reference date</th>
                        </tr>
                    </thead>
                    <tbody>
                        {this.state.json.map((data, i) => {
                        return (
                            <tr key={i}>
                            <td>{data.region_name}</td>
                            <td>{data.region_alpha_code}</td>
                            <td>{data.value}</td>
                            <td>{data.ref_date}</td>
                            </tr>
                        )
                        })}
                    </tbody>
                </table>
            </div>
        )
    }
}

export default MainTable;






